// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "./lib/IIdentityRegistry.sol";
import "./identityRegistry.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";

contract Queans {

    using EnumerableSet for EnumerableSet.AddressSet;

    Relation[] relationList;
    EnumerableSet.AddressSet users;

    mapping(uint=>Question) questions;
    uint numQuestions;

    IIdentityRegistry public idm; 

    constructor() {  
    }

    struct Question {
        string text;
        address[] votes;
        address author;
    }

    struct Relation {
        uint ID;
        uint startOfRelation; //time when the relation starts, e.g. 18.3.2023 20:00
        uint questionCloseTime; //after this time you can not ask questions e.g. 18.3.2023 21:00
        string name; // e.g. CNN Covid Discussion
        string description;
        uint[] questionsKeys; // question numbers
    }

    function update(address addr) public {
        idm = IdentityRegistry(address(addr));
    }

    // bude external, volat ji bude druhy SC
    // verifiableCredentials = {walletAddress, signature_IDM_Provider}

    function addUser(address walletAddress) public {
        //require(idm.verifyIdentity(walletAddress) == true, "User does not have verified identity");
        require(users.contains(walletAddress) == false, "User is already added");
        users.add(walletAddress);
    }

    function voteForQuestion(uint questionKey) payable public {
        //require(idm.verifyIdentity(msg.sender) == true, "User does not have verified identity");
        require(users.contains(msg.sender) == true, "User is not added");
        require(msg.sender != getQuestion(questionKey).author, "You can not vote for your own question");
        require(msg.value >= 1, "You must pay at least 1 ETH to vote");
        require(getVoter(msg.sender, questionKey) == false, "You already voted for this question");
        questions[questionKey].votes.push(msg.sender);
    }

    function getVoter(address voter, uint questionKey) public view returns(bool response){
        for(uint i = 0; i < getQuestion(questionKey).votes.length; i++) {
            if (getQuestion(questionKey).votes[i] == voter) {
                return true;
            }
        }
        return false;
    }

    // bude payable? 
    // může ji volat kdokoliv nebo jen pověřené osoby?
    function addRelation(uint _startOfRelation, uint _questionCloseTime, string memory _name, string memory _description) payable public {
        //require(idm.verifyIdentity(msg.sender) == true, "User does not have verified identity");
        require(users.contains(msg.sender) == true, "User is not added");
        Relation memory r;
        r.ID = getRelationsCount();
        r.startOfRelation = _startOfRelation;
        r.questionCloseTime = _questionCloseTime;
        r.name = _name;
        r.description = _description;
        relationList.push(r);
    }

    function getRelation(uint id) public view returns(Relation memory relation) {
        return relationList[id];
    }

    function getAllRelations() public view returns(Relation [] memory) {
        return relationList;
    }

    function getRelationsCount() public view returns(uint relLenght) {
        return relationList.length;
    }

    function addQuestion(string memory _text, uint relationID) payable public {
        //require(idm.verifyIdentity(msg.sender) == true, "User does not have verified identity");
        require(users.contains(msg.sender) == true, "User is not added");
        require(checkUserQuestion(msg.sender, getRelation(relationID)) == false, "user already added question into this relation");
        address[] memory questionVotes;
        Question memory que;
        que.text = _text;
        que.votes = questionVotes;
        que.author = msg.sender;
        questions[numQuestions] = que;
        relationList[relationID].questionsKeys.push(numQuestions);
        numQuestions += 1;
    }

    function checkUserQuestion(address userAddr, Relation memory relation) public view returns(bool) {
        for(uint i = 0; i < relation.questionsKeys.length; i++) {
            if (getQuestion(relation.questionsKeys[i]).author == userAddr)
                return true;
        }
        return false;
    }

    function getQuestion(uint id) public view returns(Question memory question) {
        return questions[id];
    }

    function getQuestionsCount() public view returns(uint queLenght) {
        return numQuestions;
    }
    
}
